import React, { Component } from "react";
import Aux from "../../hoc/Aux";

import NavigationItems from "../../components/Navigation/NavigationItems/NavigationItems";
import Collection from "../../components/collections/collection/collection";
import { Route } from "react-router-dom";

class CollectionBuilder extends Component {
  state = {
    collections: [1, 2, 3],
    materialsBorrowed: [],
    frequentlyUsed: [],
    infrequentlyUsed: [],
    renderedMaterials: [],
    attributes: [],
    showTable: false,
    tableTitle: "",
    collectionsInfo: {
      totalCollections: 0,
      borrowedCollection: 0,
      frequentlyUsed: 0,
      infrequentlyUsed: 0,
    },
  };

  componentDidMount() {
    console.log("In CollectionBuilder");
  }

  render() {
    const links = ["collection", "acquisition"];
    return (
      <Aux>
        <header>
          <nav>
            <NavigationItems items={links} />
          </nav>
        </header>
        <div className="container">
          <Route
            path="/"
            render={() => (
              <Collection collectionsInfo={this.state.collectionsInfo} />
            )}
          />
        </div>
      </Aux>
    );
  }
}
export default CollectionBuilder;
